const App = () => {
  const [inc, setinc] = useState([
    {
      name: "salary",
      amount: 500,
    },
    {
      name: "bonus",
      amount: 50,
    },
  ]);
  return (
    <div className="container">
      <div className="inner-container">
        <h1 className="title">BUDGET TRACKER</h1>

        <Balance />

        <IncExpView />
        <AddIncome />
        <AddExpense />
      </div>
    </div>
  );
};

export default App;
